import * as React from "react";
import { Layout, Menu, Icon } from "antd";
import DefaultLayout from "../layouts/default";
import { NextPage } from "next";

const { SubMenu } = Menu;
const { Sider } = Layout;

type TMenuItem = {
  title: string;
};
type TSubMenu = {
  iconType: string;
  title: string;
  menuItems: TMenuItem[];
};

const subMenus: TSubMenu[] = [
  {
    iconType: "user",
    title: "Layout",
    menuItems: [{ title: "Box" }, { title: "Container" }, { title: "Grid" }]
  },
  {
    iconType: "user",
    title: "Inputs",
    menuItems: [
      { title: "Button" },
      { title: "Checkbox" },
      { title: "Date / Time" },
      { title: "Radio" },
      { title: "Select" },
      { title: "Slider" },
      { title: "Switch" },
      { title: "Text Field" },
      { title: "Transfer List" }
    ]
  },
  {
    iconType: "user",
    title: "Navigation",
    menuItems: [
      { title: "Bottom Navigation" },
      { title: "Breadcrumbs" },
      { title: "Drawer" },
      { title: "Link" },
      { title: "Menu" },
      { title: "Stepper" },
      { title: "Tabs" }
    ]
  },
  {
    iconType: "user",
    title: "Surfaces",
    menuItems: [
      { title: "App Bar" },
      { title: "Paper" },
      { title: "Card" },
      { title: "Expansion Panel" }
    ]
  },
  {
    iconType: "user",
    title: "Feedback",
    menuItems: [
      { title: "Progress" },
      { title: "Dialog" },
      { title: "Snackbar" },
      { title: "Backdrop" }
    ]
  },
  {
    iconType: "user",
    title: "Data Display",
    menuItems: [
      { title: "Avatar" },
      { title: "Badge" },
      { title: "Chip" },
      { title: "Divider" },
      { title: "Icons" },
      { title: "Materil Icons" },
      { title: "List" },
      { title: "Table" },
      { title: "Tooptip" },
      { title: "Typography" }
    ]
  }
];

const IndexPage: NextPage = () => {
  return (
    <DefaultLayout>
      <Layout>
        <Sider width={200} style={{ background: "#fff" }}>
          <Menu
            mode="inline"
            defaultSelectedKeys={["1"]}
            defaultOpenKeys={["sub1"]}
            style={{ height: "100%", borderRight: 0 }}
          >
            {subMenus.map((subMenu: TSubMenu, subMenuIndex: number) => (
              <SubMenu
                key={subMenuIndex}
                title={
                  <span>
                    <Icon type={subMenu.iconType} />
                    {subMenu.title}
                  </span>
                }
              >
                {subMenu.menuItems.map((item: TMenuItem, itemIndex: number) => (
                  <Menu.Item
                    key={`${subMenuIndex}-${itemIndex}`}
                    onClick={alert("hoge")}
                  >
                    {item.title}
                  </Menu.Item>
                ))}
              </SubMenu>
            ))}
          </Menu>
        </Sider>
      </Layout>
    </DefaultLayout>
  );
};

export default IndexPage;
